var w = canvas.width;
var h = canvas.height;
var closestPoint;
var dragOffsetX;
var dragOffsetY;
var cursor;

const minDist = 20;

const shortLineStyle = {
	lineWidth: 2,
	strokeStyle: "cyan",
}
const lineStyle = {
	lineWidth: 2,
	strokeStyle: "black",
}
const longLineStyle = {
	lineWidth: 2,
	strokeStyle: "red",
}
const pointStyle = {
	lineWidth: 1,
	strokeStyle: "blue",
}
const fixedPointStyle = {
	lineWidth: 3,
	strokeStyle: "blue",
}
const outsidePointStyle = {
	lineWidth: 2,
	strokeStyle: "magenta",
}
const outsideFixedPointStyle = {
	lineWidth: 4,
	strokeStyle: "cyan",
}
const highlightStyle = {
	lineWidth: 3,
	strokeStyle: "red",
}
const gridStyle = {
	lineWidth: 1,
	strokeStyle: "#bbb",
}

Number.prototype.clamp = function(min, max) {
	return Math.min(max, Math.max(min, this));
}

function update(timer) {
	cursor = "crosshair";
	globalTime = timer;
	ctx.setTransform(1, 0, 0, 1, 0, 0);
	ctx.globalAlpha = 1;
	if (w == 0 || h == 0 || sz != document.getElementById("szRange").valueAsNumber) {
		var nsz = document.getElementById("szRange").valueAsNumber;
		w = canvas.width = (maxX - minX) * nsz;
		h = canvas.height = (maxY - minY) * nsz;
		if (pts.items.length > 0) {
			pts.eachItem(pt => {
				pt.x = Math.round(pt.x / sz * nsz);
				pt.y = Math.round(pt.y / sz * nsz);
			});
			lines.eachItem(line => {
				line.len = Math.round(line.len / sz / sz) * nsz * nsz;
			});
		} else {
			fig["vertices"].forEach(pt => { pts.add(Point((pt[0] - minX) * nsz, (pt[1] - minY) * nsz, false)) });
			fig["edges"].forEach(uv => { lines.add(Line(uv[0], uv[1], d2(pts.items[uv[0]], pts.items[uv[1]]))) });
		}
		sz = nsz;
	} else {
		ctx.clearRect(0, 0, w, h);
	}

	ctx.fillStyle = "#aaa";
	ctx.rect(0, 0, w, h);
	ctx.fill();
	ctx.fillStyle = "#fff";
	ctx.beginPath();
	ctx.moveTo((hole[hole.length - 1][0] - minX) * sz, (hole[hole.length - 1][1] - minY) * sz);
	hole.forEach(p => {
		ctx.lineTo((p[0] - minX) * sz, (p[1] - minY) * sz);
	});
	ctx.fill();

	if (mouse.drag === false) {
		closestPoint = pts.getClosest(mouse, minDist);
	}
	if (mouse.dragStart) {
		if (closestPoint) {
			dragOffsetX = closestPoint.x - mouse.x;
			dragOffsetY = closestPoint.y - mouse.y;
			cursor = "move";
		} else {
			mouse.drag = false;
		}
		mouse.dragStart = false;
	} else if (mouse.drag) {
		closestPoint.x = closestGrid(mouse.x + dragOffsetX);
		closestPoint.y = closestGrid(mouse.y + dragOffsetY);
		cursor = "move";

		document.getElementById("result").value = '{"vertices": [' + pts.items.map(pt => "[" + (minX + Math.round(pt.x / sz)) + ", " + (minY + Math.round(pt.y / sz)) + "]").join(", ") + ']}';
		document.getElementById("score").innerHTML = 'Score: ' + calcScore();
	} else if (mouse.dragEnd) {
		if (mouse.dragStartX === mouse.x && mouse.dragStartY === mouse.y) {
			if (closestPoint) {
				closestPoint.fixed ^= true;
			}
		}
		mouse.dragEnd = false;
	}

	if (document.getElementById("stringsCheck").checked) {
		var ds = [];
		pts.eachItem(pt => {
			if (pt.fixed || (pt === closestPoint && mouse.drag)) {
				ds.push([0, 0]);
				return;
			}
			var dx = 0, dy = 0;
			lines.eachItem(line => {
				if (pts.items[line.p1] !== pt && pts.items[line.p2] !== pt) {
					return;
				}
				const cur = d2(pts.items[line.p1], pts.items[line.p2]);
				if (cur == 0) {
					//
				} else if (cur < line.len * (1 - eps)) {
					const k = Math.sqrt(line.len * (1 - eps) / cur) - 1;
					const idx = pts.items[line.p1] === pt ? line.p2 : line.p1;
					dx -= (pts.items[idx].x - pt.x) * k;
					dy -= (pts.items[idx].y - pt.y) * k;
				} else if (cur > line.len * (1 + eps)) {
					const k = 1 - Math.sqrt(line.len * (1 + eps) / cur);
					const idx = pts.items[line.p1] === pt ? line.p2 : line.p1;
					dx += (pts.items[idx].x - pt.x) * k;
					dy += (pts.items[idx].y - pt.y) * k;
				}
			});
			// pt.x = closestGrid(pt.x + dx);
			// pt.y = closestGrid(pt.y + dy);
			const h = Math.hypot(dx, dy);
			if (h > 10) {
				dx = dx / h * 10;
				dy = dy / h * 10;
			}
			ds.push([dx, dy]);
		});
		for (var i = 0; i < pts.items.length; ++i) {
			pts.items[i].x = closestGrid(pts.items[i].x + ds[i][0]).clamp(0, (maxX - minX) * sz);
			pts.items[i].y = closestGrid(pts.items[i].y + ds[i][1]).clamp(0, (maxY - minY) * sz);
		}

		document.getElementById("result").value = '{"vertices": [' + pts.items.map(pt => "[" + (minX + Math.round(pt.x / sz)) + ", " + (minY + Math.round(pt.y / sz)) + "]").join(", ") + ']}';
		document.getElementById("score").innerHTML = 'Score: ' + calcScore();
	}

	setStyle(gridStyle);
	for (var i = minX; i < maxX; ++i) {
		ctx.beginPath();
		ctx.moveTo((i - minX + 1) * sz, 0);
		ctx.lineTo((i - minX + 1) * sz, (maxY - minY) * sz);
		ctx.stroke();
	}
	for (var i = minY; i < maxY; ++i) {
		ctx.beginPath();
		ctx.moveTo(0, (i - minY + 1) * sz);
		ctx.lineTo((maxX - minX) * sz, (i - minY + 1) * sz);
		ctx.stroke();
	}

	task["bonuses"].forEach(bonus => {
		const x = (bonus["position"][0] - minX) * sz;
		const y = (bonus["position"][1] - minY) * sz;
		setStyle(highlightStyle);
		ctx.beginPath();
		ctx.moveTo(x - Math.round(sz / 2), y - Math.round(sz / 2));
		ctx.lineTo(x + Math.round(sz / 2), y + Math.round(sz / 2));
		ctx.moveTo(x - Math.round(sz / 2), y + Math.round(sz / 2));
		ctx.lineTo(x + Math.round(sz / 2), y - Math.round(sz / 2));
		ctx.stroke();
	});

	lines.eachItem(line => {
		const cur = d2(pts.items[line.p1], pts.items[line.p2]);
		if (cur < line.len * (1 - eps)) {
			setStyle(shortLineStyle);
		} else if (cur > line.len * (1 + eps)) {
			setStyle(longLineStyle);
		} else {
			setStyle(lineStyle);
		}
		ctx.beginPath();
		drawLine(line);
		ctx.stroke();
	});

	// setStyle(lineStyle);
	// ctx.beginPath();
	// lines.draw();
	// ctx.stroke();

	pts.eachItem(pt => {
		const p = [Math.round(pt.x / sz) + minX, Math.round(pt.y / sz) + minY];
		if (pt === closestPoint) {
			setStyle(highlightStyle);
		} else if (isIn(p)) {
			setStyle(pt.fixed ? fixedPointStyle : pointStyle);
		} else {
			setStyle(pt.fixed ? outsideFixedPointStyle : outsidePointStyle);
		}
		ctx.beginPath();
		drawPoint(pt);
		ctx.stroke();
	});

	// setStyle(pointStyle);
	// ctx.beginPath();
	// pts.draw();
	// ctx.stroke();

	// setStyle(highlightStyle);
	// ctx.beginPath();
	// if (closestPoint) {
	// 	drawPoint(closestPoint);
	// }
	// ctx.stroke();

	if (closestPoint) {
		setStyle(lineStyle);
		ctx.font = "24px serif";
		ctx.strokeText(pts.items.findIndex((p => p === closestPoint)), closestPoint.x - 10, closestPoint.y - 10);
	}

	// canvas.style.cursor = cursor;

	requestAnimationFrame(update);
}

requestAnimationFrame(update);

